import * as React from "react";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";

export default function QuestionPage(props) {
  return (
    <div>
      {props.icon}
      <Typography variant="h5" component="div" gutterBottom>
        {props.question}
      </Typography>
      <Button
        sx={{ margin: 1 }}
        onClick={() => {
          props.setTree(props.tree.left);
        }}
        size="large"
        variant="contained"
      >
        Yes
      </Button>
      <Button
        sx={{ margin: 1 }}
        onClick={() => {
          props.setTree(props.tree.right);
        }}
        size="large"
        variant="contained"
      >
        No
      </Button>
    </div>
  );
}
